import styled from "styled-components";

export const SignInUpContainer = styled.div`
  width: 380px;
  display: flex;
  flex-direction: column;
`;

export const ButtonsContainer = styled.div`
  display: flex;
  justify-content: space-between;
`;

export const Title = styled.h2`
  margin: 10px 0;
`;
